  return (
    <div className='container px-5 py-24 mx-auto'>
      { drones === null ? <span>Loading...</span> :
        <div className='fex flex-col w-full mb-20'>
          {drones.children[0].attributes.deviceId}
        </div>
      }
    </div>
  )

}

export default Body;
